import React from 'react';
import { BrowserRouter, Route} from 'react-router-dom/cjs/react-router-dom.min';
import './App.css';

const Home = () => {
  return (
    <div>
      Home
    </div>
  )
}
const Clothes = () => {
  return (
    <div>
      Clothes
    </div>
  )
}
const Pets = () => {
  return (
    <div>
      Pets
    </div>
  )
}
const Furniture = () => {
  return (
    <div>
      Furniture
    </div>
  )
}
const Electronics = () => {
  return (
    <div>
      Electronics
    </div>
  )
}
const Cart = () => {
  return (
    <div>
      Cart
    </div>
  )
}


class App extends React.Component {
  render() {
    return (
      <div className="Navbar">
        <BrowserRouter>
          <Route path="/" exact Component={Home} />
          <h2>Home</h2>
          <h2>Clothes</h2>
          <h2>Pets</h2>
          <h2>Furniture</h2>
          <h2>Electronics</h2>
          <h3 className='Cart'>Cart</h3>
        </BrowserRouter>
      </div>
    )
  }
}
export default App;
